import React from 'react';
import './shopnav.css'

const ShopNav = () => {
    return (
        <div className='shop-nav'>
            <ul className='shop-links'>
                <li>Vinyl</li>
                <li>Hats</li>
                <li>Shirts</li>
            </ul>
            <div>
                Cart
            </div>
        </div>
    );
};

export default ShopNav;
